export const ADD_NOTE = "ADD_NOTE";

export const addNote = (title, description) => {
    return {
        type: ADD_NOTE,
        payload: {
            title: title, description: description
        }
    };
};

export const DELETE_NOTE = 'DELETE_NOTE';

export const deleteNote = (id) => {
    return {
          type: DELETE_NOTE,
        payload: id,
    }
}
;
